import React, { Component } from "react";
import '../App.css';
import NoteComponent from '../components/NoteComponent'

class Home extends Component {


    render() {
        return (
            <div className="App">
                <header className="App-header">
            <NoteComponent/>
                </header>
            </div>
        )
    }

}


export default Home;
